import React from 'react';
import './App.css';
import Header from './Header.js'
import Container from './Container.js'


class App extends React.Component {

  render() {
    return (
      <div>
        <div className="AppHeader">
          {this.renderHeader()}
        </div>
        <div className="AppContainer">
          {this.renderContainer()}
        </div>
      </div>
    );
  }

  renderHeader() {
    return <Header/>;
  }
  renderContainer() {
    return <Container/>;
  }
}

export default App;
